import "./Home.css";
import { useEffect } from "react";
// import url from "../../public/audios/start.mp3";
const Home = () => {
  const url = process.env.PUBLIC_URL + "/audios/start.mp3";
  const loadHandler = () => {
    //   const [playing, setPlaying] = useState(false);
    const audio = new Audio(url);
    audio.play();
  };
  useEffect(() => {
    const audio = new Audio(url);
    audio.play();
    console.log("hello");
  }, []);
  return (
    <div id="homeDiv" onLoad={loadHandler}>
      <h1 id="homeHead">Welcome to Tortuga islands!</h1>
      <h5>Login to continue.</h5>
      <button className="btn danger">Pirate Login</button>
      <br />
      <button className="btn success">Admin Login</button>
    </div>
  );
};

export default Home;
